pragma solidity ^0.4.11;

contract Notes {

	// 笔记结构体
	struct Note {
		string time;
		string content;
	}

	// 用户结构体
	struct User {
		address userAddress;
		string username;
		Note note;
	}

	// 所有地址和用户名
	address[] userAddresses;
	string[] usernames;
	
	/*
	string[] testc;
	function getTest() public constant returns (uint) {
		return testc.length;
	}
	function setTest(string _testc) public {
		testc.push(_testc);
	}
	*/

	// 映射
	mapping(address => User) userAddressMap;
	mapping(string => User) usernameMap;

	function isExistUserAddress(address _userAddress) public constant returns (bool) {
		for(uint i = 0; i < userAddresses.length; i++){
			if(userAddresses[i] == _userAddress) return true;
		}
		return false;
	}

	uint256 _unixTimestamp;
	uint256 _timeExpired;
	function isExistUsername(string _username) public constant returns (bool) {
		for(uint i = 0; i < usernames.length; i++){
			if(keccak256(abi.encodePacked(usernames[i], _unixTimestamp, _timeExpired)) == keccak256(abi.encodePacked(_username, _unixTimestamp, _timeExpired))) {
			//if(keccak256(usernames[i]) == keccak256(_username)) {
				return true;
			}
		}
		return false;
	}

	function findUserAddressByUsername(string _username) public constant returns (address) {
		require (isExistUsername(_username));
		return usernameMap[_username].userAddress;
	}

	function createUser(address _userAddress, string _username) public {
		require (!isExistUserAddress(_userAddress));
		require (!isExistUsername(_username));

		userAddresses.push(_userAddress);
		usernames.push(_username);

		userAddressMap[_userAddress] =  User(_userAddress, _username, Note("", ""));
		usernameMap[_username] =  User(_userAddress, _username, Note("", ""));
	}

	function getUserCount() public constant returns (uint) {
		return usernames.length;
	}

	function setNote(address _userAddress, string _content, string _time) public {
		require (isExistUserAddress(_userAddress));
		userAddressMap[_userAddress].note.time = _time;
		userAddressMap[_userAddress].note.content = _content;
	}

	function getNote(address _userAddress) public constant returns (string, string) {
		require (isExistUserAddress(_userAddress));
		return (userAddressMap[_userAddress].note.time, userAddressMap[_userAddress].note.content);
	}
}
